  true,\n\t\"url\": null,\n\t\"notes\": \"Data updated 10/17/2016. The Existing Commercial
  Buildings Energy Performance Ordinance (Environment Code Chapter 20) requires that
  each non-residential building with at least 10,000 square feet of conditioned (heated
  or cooled) space must be benchmarked using Energy Star Portfolio Manager annually,
  and undergo an energy audit or retrocommissioning at least once every 5 years. rnrnMore
  information: www.sfenvironment.org/ecb This dataset lists compliance status for
  private-sector (non-municipal) properties where the owner has been notified a building
  is subject to the ordinance. Fields reported have expanded as of early October 2015
  to include energy use intensity, the 1-100 Portfolio Manager rating, and estimated
  greenhouse gas emissions from annual energy consumption.rnrnView the data lens feature
  here: https://data.sfgov.org/Energy-and-Environment/Existing-Commercial-Buildings-Energy-Performance-O/v3c6-n4qs\",\n\t\"license_title\":
